import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = ({ audioFile }) => {
  const playAudio = () => {
    if (audioFile) {
      const audio = new Audio(audioFile);
      audio.play();
    }
  };

  return (
    <div id="menu">
      <Link className="menuItem" to="/">Home</Link>
      <div className="dropdown">
        <Link className="menuItem dropbtn" to="/support">Support <i className="fas fa-chevron-down"></i></Link>
        <div className="dropdown-content">
          <Link to="/forum">Forum</Link>
        </div>
      </div>
      <div id="readWholePage" onClick={playAudio}>
        <div id="speakerBox">
          <span id="readWholePageText">Read Whole Page</span>
          <i className="fas fa-volume-up" id="speakerIcon"></i>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
